import { Container, Stack } from '@mui/material'
import React from 'react'
import pic from '../Media/service.png'

export default function Services() {
  return (
    <div style={{marginTop:'100px'}}>
      <Stack direction='row' >
        <img src={pic} style={{height:'600px',objectFit:'cover'}}/>

        <Container></Container>
      </Stack>
    </div>
  )
}
